const int maxVelocityFront = 20;
const int minVelocityEgo = -10;
const int minVelocityFront = -10;

const int maxSensorDistance = 200;

clock waitTimer;

//int distance = 20;
int distance_gua_old[2] = {20,20}; // minimum lower and maximum upper bound during next interfall
int distance_gua_evol_old[2] = {20,20}; // lower and upper bound at end next interfall
int distance_gua_new[2] = {20,20}; // minimum lower and maximum upper bound during next interfall
int distance_gua_evol_new[2] = {20,20}; // lower and upper bound at end next interfall
//int old_distance_gua = 10;

int velocityEgo_gua_old[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityEgo_gua_evol_old[2];// = {0,0}; // lower and upper bound at end next interfall
int velocityEgo_gua_new[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityEgo_gua_evol_new[2];// = {0,0}; // lower and upper bound at end next interfall
//int velocityEgo;
int[-2,2] accelerationEgo;
broadcast chan chooseEgo;

int velocityFront_gua_old[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityFront_gua_evol_old[2];// = {0,0}; // lower and upper bound at end next interfall
int velocityFront_gua_new[2];// = {0,0}; // minimum lower and maximum upper bound during next interfall
int velocityFront_gua_evol_new[2];// = {0,0}; // lower and upper bound at end next interfall
//int velocityFront;
int[-2,2] accelerationFront;
broadcast chan chooseFront;

//typedef int idt[2];



const int number_modes = 9;

const double OSL[number_modes] = {0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547,0.707106781186547};
const double LIP[number_modes] = {1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308,1.41421356237308};
// Modes
//   2   2   2   0   0   0  -2  -2  -2
//   2   0  -2   2   0  -2   2   0  -2
//   0   0   0   0   0   0   0   0   0
const double MAXF1_old = 2.828427124746190;
const double MAXF2_old  = 2.0;
const double MAXF3_old  = 2.828427124746190;
const double MAXF4_old  = 2.0;
const double MAXF5_old  = 0.0;
const double MAXF6_old  = 2.0;
const double MAXF7_old  = 2.828427124746190;
const double MAXF8_old  = 2.0;
const double MAXF9_old  = 2.828427124746190;

const double MAXF1_new = 30.133038346638727;
const double MAXF2_new = 30.066592756745816;
const double MAXF3_new = 30.133038346638727;
const double MAXF4_new = 30.066592756745816;
const double MAXF5_new = 30.0;
const double MAXF6_new = 30.066592756745816;
const double MAXF7_new = 30.133038346638727;
const double MAXF8_new = 30.066592756745816;
const double MAXF9_new = 30.133038346638727;

const double C0F_old[number_modes] = {MAXF1_old*LIP[0],MAXF2_old*LIP[1],MAXF3_old*LIP[2],MAXF4_old*LIP[3],MAXF5_old*LIP[4],MAXF6_old*LIP[5],MAXF7_old*LIP[6],MAXF8_old*LIP[7],MAXF9_old*LIP[8]};
const double C0F_new[number_modes] = {MAXF1_new*LIP[0],MAXF2_new*LIP[1],MAXF3_new*LIP[2],MAXF4_new*LIP[3],MAXF5_new*LIP[4],MAXF6_new*LIP[5],MAXF7_new*LIP[6],MAXF8_new*LIP[7],MAXF9_new*LIP[8]};

const int euler_sub_step = 30;
const double tau = 1.0/euler_sub_step;

int find_mode(int accFront, int accEgo){
    int mode_det;
    if(accFront == 2 && accEgo == 2){mode_det = 0;}
    if(accFront == 2 && accEgo == 0){mode_det = 1;}
    if(accFront == 2 && accEgo == -2){mode_det = 2;}
    if(accFront == 0 && accEgo == 2){mode_det = 3;}
    if(accFront == 0 && accEgo == 0){mode_det = 4;}
    if(accFront == 0 && accEgo == -2){mode_det = 5;}
    if(accFront == -2 && accEgo == 2){mode_det = 6;}
    if(accFront == -2 && accEgo == 0){mode_det = 7;}
    if(accFront == -2 && accEgo == -2){mode_det = 8;}
    return mode_det;
}

double delta_test_old;
double delta_test_new;
double rho;

double delta_mode_old(double delta, int mode){
    if (OSL[mode] > 0) {
        return sqrt(delta*delta*exp(3*OSL[mode]*tau) + C0F_old[mode]*C0F_old[mode]/(3*OSL[mode]*OSL[mode])*(-tau*tau - 2*tau/(3*OSL[mode]) + 2/(9*OSL[mode]*OSL[mode])*(exp(3*OSL[mode]*tau)-1)));       
    }
    if (OSL[mode] == 0) {
        return sqrt(delta*delta*exp(tau) + C0F_old[mode]*(-tau*tau -2*tau + 2*(exp(tau)-1)));
    }
    if (OSL[mode] < 0) {
        return sqrt(delta*delta*exp(OSL[mode]*tau) + (C0F_old[mode]*C0F_old[mode]/(OSL[mode]*OSL[mode]))*(tau*tau+2*tau/OSL[mode]+2/(OSL[mode]*OSL[mode])-2*exp(OSL[mode]*tau)/(OSL[mode]*OSL[mode])));
    }
    return(0);
}

double delta_mode_new(double delta, int mode){
    if (OSL[mode] > 0) {
        return sqrt(delta*delta*exp(3*OSL[mode]*tau) + C0F_new[mode]*C0F_new[mode]/(3*OSL[mode]*OSL[mode])*(-tau*tau - 2*tau/(3*OSL[mode]) + 2/(9*OSL[mode]*OSL[mode])*(exp(3*OSL[mode]*tau)-1)));       
    }
    if (OSL[mode] == 0) {
        return sqrt(delta*delta*exp(tau) + C0F_new[mode]*C0F_new[mode]*(-tau*tau -2*tau + 2*(exp(tau)-1)));
    }
    if (OSL[mode] < 0) {
        return sqrt(delta*delta*exp(OSL[mode]*tau) + (C0F_new[mode]*C0F_new[mode]/(OSL[mode]*OSL[mode]))*(tau*tau+2*tau/OSL[mode]+2/(OSL[mode]*OSL[mode])-2*exp(OSL[mode]*tau)/(OSL[mode]*OSL[mode])));
    }
    return(0);
}


double mini(double d1, double d2){
    if(d1 < d2){return d1;}
    else{return d2;}
}

double maxi(double d1, double d2){
    if(d1 < d2){return d2;}
    else{return d1;}
}

void eulerDiscrete(){
    //double velEgo, velFront, 
    double dist_old, velEgo_old, velFront_old, delta_old;
    double dist_new, velEgo_new, velFront_new, delta_new;
    double memdist_min_old, memdist_max_old, memVF_min_old, memVF_max_old, memVE_min_old, memVE_max_old;
    double memdist_min_new, memdist_max_new, memVF_min_new, memVF_max_new, memVE_min_new, memVE_max_new;

    int i;

    dist_old = (distance_gua_evol_old[0]+distance_gua_evol_old[1])/2;
    velFront_old = (velocityFront_gua_evol_old[0]+velocityFront_gua_evol_old[1])/2;
    velEgo_old = (velocityEgo_gua_evol_old[0]+velocityEgo_gua_evol_old[1])/2;

    dist_new = (distance_gua_evol_new[0]+distance_gua_evol_new[1])/2;
    velFront_new = (velocityFront_gua_evol_new[0]+velocityFront_gua_evol_new[1])/2;
    velEgo_new = (velocityEgo_gua_evol_new[0]+velocityEgo_gua_evol_new[1])/2;

    delta_old = sqrt((distance_gua_evol_old[1]-distance_gua_evol_old[0])*(distance_gua_evol_old[1]-distance_gua_evol_old[0])/4 + (velocityFront_gua_evol_old[1]-velocityFront_gua_evol_old[0])*(velocityFront_gua_evol_old[1]-velocityFront_gua_evol_old[0])/4 + (velocityEgo_gua_evol_old[1]-velocityEgo_gua_evol_old[0])*(velocityEgo_gua_evol_old[1]-velocityEgo_gua_evol_old[0])/4);
    delta_new = sqrt((distance_gua_evol_new[1]-distance_gua_evol_new[0])*(distance_gua_evol_new[1]-distance_gua_evol_new[0])/4 + (velocityFront_gua_evol_new[1]-velocityFront_gua_evol_new[0])*(velocityFront_gua_evol_new[1]-velocityFront_gua_evol_new[0])/4 + (velocityEgo_gua_evol_new[1]-velocityEgo_gua_evol_new[0])*(velocityEgo_gua_evol_new[1]-velocityEgo_gua_evol_new[0])/4);
    rho = delta_old;

    memdist_min_old = dist_old - delta_old;
    memdist_max_old = dist_old + delta_old;
    memVF_min_old = velFront_old - delta_old;
    memVF_max_old = velFront_old + delta_old;
    memVE_min_old = velEgo_old - delta_old;
    memVE_max_old = velEgo_old + delta_old;

    memdist_min_new = dist_new - delta_new;
    memdist_max_new = dist_new + delta_new;
    memVF_min_new = velFront_new - delta_new;
    memVF_max_new = velFront_new + delta_new;
    memVE_min_new = velEgo_new - delta_new;
    memVE_max_new = velEgo_new + delta_new;

    for (i=0;i<=euler_sub_step - 1;i++){
        dist_old = dist_old + tau*(velFront_old - velEgo_old);
        velEgo_old = velEgo_old + tau*accelerationEgo;
        velFront_old = velFront_old + tau*accelerationFront;

        dist_new = dist_new + tau*(velFront_new - velEgo_new);
        velEgo_new = velEgo_new + tau*accelerationEgo;
        velFront_new = velFront_new + tau*accelerationFront;

        delta_old = delta_mode_old(delta_old,find_mode(accelerationFront,accelerationEgo));
        delta_new = delta_mode_new(delta_new,find_mode(accelerationFront,accelerationEgo));

        memdist_min_old = mini(memdist_min_old,dist_old-delta_old);
        memdist_max_old = maxi(memdist_max_old,dist_old+delta_old);
        memVF_min_old = mini(memVF_min_old,velFront_old-delta_old);
        memVF_max_old = maxi(memVF_max_old,velFront_old+delta_old);
        memVE_min_old = mini(memVE_min_old,velEgo_old-delta_old);
        memVE_max_old = maxi(memVE_max_old,velEgo_old+delta_old);

        memdist_min_new = mini(memdist_min_new,dist_new-delta_new);
        memdist_max_new = maxi(memdist_max_new,dist_new+delta_new);
        memVF_min_new = mini(memVF_min_new,velFront_new-delta_new);
        memVF_max_new = maxi(memVF_max_new,velFront_new+delta_new);
        memVE_min_new = mini(memVE_min_new,velEgo_new-delta_new);
        memVE_max_new = maxi(memVE_max_new,velEgo_new+delta_new);

    }
    delta_test_old = delta_old;
    delta_test_new = delta_new;

    distance_gua_old[0] = flo(memdist_min_old);
    distance_gua_old[1] = cei(memdist_max_old);
    velocityFront_gua_old[0] = flo(memVF_min_old);
    velocityFront_gua_old[1] = cei(memVF_max_old);
    velocityEgo_gua_old[0] = flo(memVE_min_old);
    velocityEgo_gua_old[1] = cei(memVE_max_old);

    distance_gua_new[0] = flo(memdist_min_new);
    distance_gua_new[1] = cei(memdist_max_new);
    velocityFront_gua_new[0] = flo(memVF_min_new);
    velocityFront_gua_new[1] = cei(memVF_max_new);
    velocityEgo_gua_new[0] = flo(memVE_min_new);
    velocityEgo_gua_new[1] = cei(memVE_max_new);

}



void updateDiscrete(){
    velocityEgo_gua_evol_old[0] = velocityEgo_gua_evol_old[0] + accelerationEgo;
    velocityEgo_gua_evol_old[1] = velocityEgo_gua_evol_old[1] + accelerationEgo;
    velocityFront_gua_evol_old[0] = velocityFront_gua_evol_old[0] + accelerationFront;
    velocityFront_gua_evol_old[1] = velocityFront_gua_evol_old[1] + accelerationFront;

    velocityEgo_gua_evol_new[0] = velocityEgo_gua_evol_new[0] + accelerationEgo;
    velocityEgo_gua_evol_new[1] = velocityEgo_gua_evol_new[1] + accelerationEgo;
    velocityFront_gua_evol_new[0] = velocityFront_gua_evol_new[0] + accelerationFront;
    velocityFront_gua_evol_new[1] = velocityFront_gua_evol_new[1] + accelerationFront;

    if (distance_gua_evol_old[0] > maxSensorDistance) {
        distance_gua_evol_old[0] = maxSensorDistance + 1;
        distance_gua_evol_old[1] = maxSensorDistance + 1;
    } else {
        // eulerDiscrete();
        distance_gua_evol_old[0] = distance_gua_evol_old[0] + (velocityFront_gua_evol_old[0]-accelerationFront) - (velocityEgo_gua_evol_old[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2;// - (oldVel + newVel)/2;
        distance_gua_evol_old[1] = distance_gua_evol_old[1] + (velocityFront_gua_evol_old[0]-accelerationFront) - (velocityEgo_gua_evol_old[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2;//(oldVel + newVel)/2;

        if (distance_gua_evol_old[1] > maxSensorDistance) {
        distance_gua_evol_old[1] = maxSensorDistance + 1;
        }
    }

     if (distance_gua_evol_new[0] > maxSensorDistance) {
        distance_gua_evol_new[0] = maxSensorDistance + 1;
        distance_gua_evol_new[1] = maxSensorDistance + 1;
    } else {
        // eulerDiscrete();
        distance_gua_evol_new[0] = distance_gua_evol_new[0] + (velocityFront_gua_evol_new[0]-accelerationFront) - (velocityEgo_gua_evol_new[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2;// - (oldVel + newVel)/2;
        distance_gua_evol_new[1] = distance_gua_evol_new[1] + (velocityFront_gua_evol_new[0]-accelerationFront) - (velocityEgo_gua_evol_new[0]-accelerationEgo) + (accelerationFront - accelerationEgo)/2;//(oldVel + newVel)/2;

        if (distance_gua_evol_new[1] > maxSensorDistance) {
        distance_gua_evol_new[1] = maxSensorDistance + 1;
        }
    }
}



